import React from 'react';
import styled from 'styled-components';
import AliPay from '../../../img/alipay.svg';
import Card from '../../../img/card.svg';
import Ideal from '../../../img/ideal.svg';
import Sepa from '../../../img/sepa.svg';





const Inline = styled.div`
   display: flex;
   justify-content: space-around;
   img{
       width: 76px;
       height: 36px;
   }

`
const Span = styled.div`
position: relative;

`
class InlineBox extends React.Component {
  render(){
    return (


            <Inline>
                <Span><img src={Card} alt="back"/></Span>
                <Span><img src={Sepa} alt="back"/></Span>
                <Span><img src={Ideal} alt="back"/></Span>
                <Span><img src={AliPay} alt="back"/></Span> 
                <Span><span>...</span></Span>
            </Inline>

    );
  }
}
export default InlineBox;
